pragma solidity >=0.5.0 <0.7.0;


interface ERC20Interface {
    function totalSupply() external view returns (uint256);

    function balanceOf(address _owner) external view returns (uint256 balance);

    function transfer(address _to, uint256 _value)
        external
        returns (bool success);

    function transferFrom(
        address _from,
        address _to,
        uint256 _value
    ) external returns (bool success);

    function approve(address _spender, uint256 _value)
        external
        returns (bool success);

    function allowance(address _owner, address _spender)
        external
        view
        returns (uint256 remaining);

    event Transfer(address indexed _from, address indexed _to, uint256 _value);
    event Approval(
        address indexed _owner,
        address indexed _spender,
        uint256 _value
    );
}


contract StandardERC20 is ERC20Interface {
    string private _name;
    string private _symbol;
    uint256 private decimal;
    uint256 private _supply;

    mapping(address => uint256) private balances;
    mapping(address => mapping(address => uint256)) private approved;

    constructor(
        string memory name,
        string memory symbol,
        uint256 supply
    ) public {
        _name = name;
        _symbol = symbol;
        decimal = 18;
        balances[msg.sender] = supply;
        _supply = supply;
    }

    function name() external view returns (string memory) {
        return _name;
    }

    function symbol() external view returns (string memory) {
        return _symbol;
    }

    function totalSupply() external view returns (uint256) {
        return _supply;
    }

    function balanceOf(address _owner) external view returns (uint256 balance) {
        return balances[_owner];
    }

    function transfer(address _to, uint256 _value) external returns (bool) {
        _transfer(msg.sender, _to, _value);
        return true;
    }

    function _transfer(
        address _from,
        address _to,
        uint256 _amount
    ) private returns (bool) {
        require(_from != _to, "StandardERC20: Not Authorized to Tranafer");
        require(
            balances[_from] >= _amount,
            "StandardERC20: Insufficient Funds"
        );
        balances[_to] += _amount;
        balances[_from] -= _amount;
        emit Transfer(_from, _to, _amount);
        return true;
    }

    function transferFrom(
        address _from,
        address _to,
        uint256 _value
    ) external returns (bool) {
        _transfer(_from, _to, _value);
        _approve(_from, _to, (approved[_from][_to] - _value));

        return true;
    }

    function approve(address _spender, uint256 _value) external returns (bool) {
        _approve(msg.sender, _spender, _value);
        return true;
    }

    function _approve(
        address owner,
        address _spender,
        uint256 _value
    ) internal {
        require(owner != _spender, "StandardERC20: Not Authorized to Approve");
        require(balances[owner] >= _value, "StandardERC20: Insufficient Funds");
        approved[owner][_spender] = _value;
        emit Approval(owner, _spender, _value);
    }

    function allowance(address _owner, address _spender)
        external
        view
        returns (uint256 remaining)
    {
        return approved[_owner][_spender];
    }
}
